import React, { Component } from "react";
import { Link } from "react-router-dom";
import Logo from "../logo/Logo";
import styled from "styled-components";

import Icon from "react-icons-kit";
import gif from "../images/video/ASK_I_MEMNU_45.mp4";
import { listAlt } from "react-icons-kit/fa/listAlt";

class PageNotFound extends Component {
  render() {
    return (
      <ErrorPage className="container">
        <Headerstyle className="container">
          <div className="header-top">
            <Logostyle>
              <Logo />
              <span className="signin">Üye Girişi</span>
            </Logostyle>
          </div>
        </Headerstyle>

        <div className="container">
          <div className="row overflow-hidden">
            <div className="playvideo">
              <div className="wrapper text-center">
                <Icon icon={listAlt} size={25} />
                <h3>Üzgünüz.. Aradığınız sayfayı bulamadık</h3>
                <Link to={"/"}> Ana sayfa </Link>
              </div>
              <video autoPlay muted loop src={gif} />
            </div>
          </div>
        </div>
      </ErrorPage>
    );
  }
}

const ErrorPage = styled.div`
  height: 100vh;
  overflow: hidden;

  .wrapper {
    position: absolute;
    left: 33%;
    top: 50%;
  }
`;

const Headerstyle = styled.div`
  background: #2e2f41;
`;

const Logostyle = styled.div`
  padding-top: 1em;
  margin-left: 5%;
  width: "auto";
  height: "auto";

  .signin {
    position: flex;
    float: right;
    padding-top: 0.5em;
    margin-right: 5%;
    font-size: 0.8rem;
    cursor: pointer;
    &:hover {
      text-decoration: underline;
    }
  }
`;

export default PageNotFound;
